e7\u00f5es apresentadas s\u00e3o realizadas com base em um modelo ARX (Auto-Regressivo com entradas eX\u00f3genas) em que as entradas s\u00e3o os dados do google mobility (percentagem de pessoas nas resid\u00eancias) atrasados em 10 dias. \u00c9 importante lembrar que os modelos ARX s\u00e3o mais adequados para predi\u00e7\u00f5es de curta dura\u00e7\u00e3o, e, quanto maior for o horizonte de predi\u00e7\u00e3o, maior ser\u00e1 o erro associado. Outro fator importante a ser considerado aqui \u00e9 que todos os modelos apresentados foram obtidos automaticamente. Isto \u00e9, existe um algoritmo que captura os dados do minist\u00e9rio da sa\u00fade e de mobilidade, e realiza as predi\u00e7\u00f5es de forma autom\u00e1tica, sem a interven\u00e7\u00e3o humana. Isto significa que, devido a particularidades dos estados quanto a coleta de informa\u00e7\u00f5es e outros fatores, as predi\u00e7\u00f5es podem n\u00e3o representar corretamente a evolu\u00e7\u00e3o das vari\u00e1veis. Por isso, essas informa\u00e7\u00f5es devem ser analisadas com cuidado e de forma cr\u00edtica."},"id":"34366","type":"Paragraph"},{"attributes":{},"id":"33858","type":"PanTool"},{"attributes":{},"id":"33859","type":"WheelZoomTool"},{"attributes":{"line_alpha":0.1,"line_color":"#3288bd","line_width":3,"x":{"field":"x"},"y":{"field":"y"}},"id":"33874","type":"Line"},{"attributes":{"overlay":{"id":"33864"}},"id":"33860","type":"BoxZoomTool"},{"attributes":{"ticks":[1584662400000.0,1585267200000.0,1585872000000.0,1586476800000.0,1587081600000.0,1587686400000.0,1588291200000.0,1588896000000.0,1589500800000.0,1590105600000.0,1590710400000.0]},"id":"33877","type":"FixedTicker"},{"attributes":{},"id":"33861","type":"SaveTool"},{"attributes":{},"id":"33862","type":"ResetTool"},{"attributes":{},"id":"33863","type":"HelpTool"},{"attributes":{"below":[{"id":"34038"}],"center":[{"id":"34041"},{"id":"34045"}],"left":[{"id":"34042"}],"plot_height":320,"renderers":[{"id":"34063"},{"id":"34070"}],"title":{"id":"3
